import React, { useState, useEffect } from "react";
import "reactjs-popup/dist/index.css";
import Modal from "react-modal";
import "./style.css";
import * as trademarkApi from "../../apis/trademark";
import * as imageApi from "../../apis/image";

const customStyles = {
  content: {
    top: "45%",
    left: "79%",
    right: "auto",
    bottom: "auto",
    marginRight: "-50%",
    transform: "translate(-50%, -50%)",
  },
};

export default function FindTrademarkModal(props) {
  const [timkiem, setTimkiem] = useState("");
  const [danhsach, setDanhsach] = useState([]);
  useEffect(() => {
    // Update the document title using the browser API
    findFunction("a");
  },[]);

  const findFunction=(timkiem)=>{
    trademarkApi.findTrademarkIdByName(timkiem).then(success =>{
      if (success.status===200) {
        console.log(success.data.value)
        setDanhsach(success.data.value.$values);
      }
    })
    .catch((error) => {
      console.error(error);
    })

  }

  return (
    <Modal
      isOpen={props.showModal}
      onRequestClose={props.closeModal}
      style={customStyles}
      contentLabel="Example Modal"
    >

      <div class="add-item-modal timkiemthuonghieu-modal" role="document">
        <div class="">

          <div className="form-main-add-edit">
            <div className="row mb-3">
              <input
                className="form-control border"
                id="image"
                placeholder="Tìm kiếm thương hiệu"
                onChange={(e) => {
                  setTimkiem(e.target.value);
                  findFunction(e.target.value);
                }}
                value = {timkiem}
              ></input>
            </div>

            <div className="list-product-data">
            {
              danhsach.map((value, key)=>{
                return (
                  <div className="modal-product-detail" key ={key}>
                  <div className="image">
                    <img alt="anh" src={imageApi.image(value.image)} />
                  </div>
                  <div className="content">
                    <div
                        target="_blank"
                    >
                             <p className="productid"> Tên thương hiệu: {value.tenthuonghieu} </p>
                      <p className="name">
                        {" "}
                        {value.xuatxu}
                        {" "}
                      </p>

                      <p className="price"> Mã thương hiệu: {value.mathuonghieu}</p>

                    </div>
                    <button className="add-to-build btn btn-primary" type="button" onClick={()=>{props.chooseFunction(value); props.closeModal()}}>
                      Chọn
                    </button>
                  </div>
                </div>
                )
              })
            }
            </div>
          </div>

          <hr></hr>

          <div class="modal-footer">
            <button
              type="button"
              class="btn btn-secondary"
              data-dismiss="modal"
              onClick={props.closeModal}
            >
              Đóng
            </button>
          </div>
        </div>
      </div>
    </Modal>
  );
}
